package darren.gong.leetcode;

import java.util.HashSet;
import java.util.Set;

public class LongestDupSubstring1044 {
  public static void main(String[] args) {
    int length = "ymadkuepightrfodmauhrsy".length();
    LongestDupSubstring1044 longestDupSubstring1044 = new LongestDupSubstring1044();
    String result = longestDupSubstring1044.longestDupSubstring("");
  }
  public String longestDupSubstring(String s) {
    if (s == null || s.length() == 0) {
      return "";
    }
    int length = s.length();
    int[] hashArray = new int[length];
    for (int i = 0; i < length; i++) {
      hashArray[i] = s.charAt(i)-'a';
    }

    int min = 1;
    int max = length;
    long module = ((long)1<<36);
    // length range:left-right
    while (min < max) {
      int currentLength = min+((max-min)>>>1);
      if (findSame(hashArray, currentLength, length, module) == -1) {
        max = currentLength;
      } else {
        min = currentLength+1;
      }
    }
    int start = findSame(hashArray, min-1, length, module);
    return start == -1 ? "" : s.substring(start, start+min-1);
  }

  private int findSame(int[] hashArray, int currentLength, int length, long module) {
    long base = 1;
    long hash = 0;
    for (int i = 0; i < currentLength; i++) {
      hash = (hash*26+hashArray[i])%module;
      base = (base*26)%module;
    }
    Set<Long> set = new HashSet<>();
    set.add(hash);
    int start = 0;
    int end = currentLength;
    while (end < length) {
      hash = (hash*26-hashArray[start]*base%module+module)%module;
      hash = (hash+hashArray[end])%module;
      if (set.contains(hash)) {
        return start+1;
      } else {
        set.add(hash);
        start++;
        end++;
      }
    }
    return -1;
  }
}
